           local center = false\
           local partners = {}\
           local num = aura_env.me % 3\
           if num == 2 then\
               center = true\
               partners[1] = aura_env.affected[aura_env.me-1]\
               partners[2] = aura_env.affected[aura_env.me+1]\
           elseif num == 1 then\
               partners[1] = aura_env.affected[aura_env.me+1]\
               partners[2] = aura_env.affected[aura_env.me+2]            \
           elseif num == 0 then\
               partners[1] = aura_env.affected[aura_env.me-1]\
